    false,nt"url": null,nt"notes": "This annual narrative report for Nantucket
    Island National Wildlife Refuge outlines Refuge accomplishments during the 1982
    calendar year. The report begins with a summary of the year's highlights. Land acquisition
    is covered. Refuge administration is outlined; information about personnel and funding
    is given. The wildlife section of the report discusses wildlife diversity, waterfowl,
    marsh birds and waterbirds, and marine mammals. The public uses of the Refuge described
    in this report include fishing and outdoor recreation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
